// src/config/history.ts
init_logs();
import * as fs7 from "fs/promises";
import * as path9 from "path";
import { homedir as homedir2 } from "os";
var HISTORY_DIR = path9.join(homedir2(), ".kilocode", "cli");
var HISTORY_FILE = path9.join(HISTORY_DIR, "history.json");
var DEFAULT_MAX_SIZE = 500;
var historyDir = HISTORY_DIR;
var historyFile = HISTORY_FILE;
var DEFAULT_HISTORY = {
  version: "1.0.0",
  entries: [],
  maxSize: DEFAULT_MAX_SIZE
};
async function ensureHistoryDir() {
  try {
    await fs7.mkdir(historyDir, { recursive: true });
  } catch (error) {
    logs.error("Failed to create history directory", "HistoryPersistence", { error });
    throw error;
  }
}
async function historyExists() {
  try {
    await fs7.access(historyFile);
    return true;
  } catch {
    return false;
  }
}
async function loadHistory() {
  try {
    await ensureHistoryDir();
    const exists = await historyExists();
    if (!exists) {
      await fs7.writeFile(historyFile, JSON.stringify(DEFAULT_HISTORY, null, 2));
      return DEFAULT_HISTORY;
    }
    const content = await fs7.readFile(historyFile, "utf-8");
    const data = JSON.parse(content);
    if (!data.version || !Array.isArray(data.entries)) {
      logs.warn("Invalid history file structure, using defaults", "HistoryPersistence");
      return DEFAULT_HISTORY;
    }
    if (!data.maxSize) {
      data.maxSize = DEFAULT_MAX_SIZE;
    }
    return data;
  } catch (error) {
    logs.error("Failed to load history", "HistoryPersistence", { error });
    return DEFAULT_HISTORY;
  }
}
async function saveHistory(data) {
  try {
    await ensureHistoryDir();
    if (data.entries.length > data.maxSize) {
      data.entries = data.entries.slice(-data.maxSize);
    }
    const jsonContent = JSON.stringify(data, null, 2);
    await fs7.writeFile(historyFile, jsonContent);
  } catch (error) {
    logs.error("Failed to save history", "HistoryPersistence", { error });
    throw error;
  }
}
function addEntry(data, prompt2) {
  if (!prompt2.trim()) {
    return data;
  }
  const lastEntry = data.entries[data.entries.length - 1];
  if (lastEntry && lastEntry.prompt === prompt2) {
    return data;
  }
  const newEntry = {
    prompt: prompt2,
    timestamp: Date.now()
  };
  const newEntries = [...data.entries, newEntry];
  const trimmedEntries = newEntries.length > data.maxSize ? newEntries.slice(-data.maxSize) : newEntries;
  return {
    ...data,
    entries: trimmedEntries
  };
}

// src/state/atoms/history.ts
init_logs();
var historyDataAtom = atom13({
  version: "1.0.0",
  entries: [],
  maxSize: 500
});
var historyIndexAtom = atom13(-1);
var historyModeAtom = atom13(false);
var originalInputAtom = atom13("");
var historyEntriesAtom = atom13((get) => {
  const data = get(historyDataAtom);
  return data.entries;
});
var currentHistoryEntryAtom = atom13((get) => {
  const entries = get(historyEntriesAtom);
  const index = get(historyIndexAtom);
  const inHistoryMode = get(historyModeAtom);
  if (!inHistoryMode || index < 0 || index >= entries.length) {
    return null;
  }
  const reverseIndex = entries.length - 1 - index;
  return entries[reverseIndex] || null;
});
var currentHistoryCommandAtom = atom13((get) => {
  const entry = get(currentHistoryEntryAtom);
  return entry?.prompt || "";
});
var canNavigateUpAtom = atom13((get) => {
  const entries = get(historyEntriesAtom);
  const index = get(historyIndexAtom);
  return index < entries.length - 1;
});
var canNavigateDownAtom = atom13((get) => {
  const index = get(historyIndexAtom);
  return index > 0;
});
var loadHistoryAtom = atom13(null, async (get, set) => {
  try {
    const data = await loadHistory();
    set(historyDataAtom, data);
  } catch (error) {
    logs.error("Failed to load history into state", "HistoryAtoms", { error });
    throw error;
  }
});
var saveHistoryAtom = atom13(null, async (get, set) => {
  try {
    const data = get(historyDataAtom);
    await saveHistory(data);
  } catch (error) {
    logs.error("Failed to save history from state", "HistoryAtoms", { error });
    throw error;
  }
});
var addToHistoryAtom = atom13(null, async (get, set, prompt2) => {
  try {
    const currentData = get(historyDataAtom);
    const newData = addEntry(currentData, prompt2);
    if (newData.entries.length !== currentData.entries.length) {
      set(historyDataAtom, newData);
      await saveHistory(newData);
    }
  } catch (error) {
    logs.error("Failed to add prompt to history", "HistoryAtoms", { error });
  }
});
var enterHistoryModeAtom = atom13(null, (get, set, originalInput = "") => {
  const entries = get(historyEntriesAtom);
  if (entries.length === 0) {
    return false;
  }
  set(historyModeAtom, true);
  set(historyIndexAtom, 0);
  set(originalInputAtom, originalInput);
  return true;
});
var exitHistoryModeAtom = atom13(null, (get, set) => {
  const wasInHistoryMode = get(historyModeAtom);
  if (wasInHistoryMode) {
    set(historyModeAtom, false);
    set(historyIndexAtom, -1);
    set(originalInputAtom, "");
  }
  return wasInHistoryMode;
});
var navigateHistoryUpAtom = atom13(null, (get, set) => {
  const canNavigate = get(canNavigateUpAtom);
  if (!canNavigate) {
    return null;
  }
  const currentIndex = get(historyIndexAtom);
  const newIndex = currentIndex + 1;
  set(historyIndexAtom, newIndex);
  const entries = get(historyEntriesAtom);
  const reverseIndex = entries.length - 1 - newIndex;
  const entry = entries[reverseIndex];
  return entry?.prompt || null;
});
var navigateHistoryDownAtom = atom13(null, (get, set) => {
  const canNavigate = get(canNavigateDownAtom);
  if (!canNavigate) {
    return null;
  }
  const currentIndex = get(historyIndexAtom);
  const newIndex = currentIndex - 1;
  set(historyIndexAtom, newIndex);
  if (newIndex < 0) {
    const originalInput = get(originalInputAtom);
    return originalInput;
  }
  const entries = get(historyEntriesAtom);
  const reverseIndex = entries.length - 1 - newIndex;
  const entry = entries[reverseIndex];
  return entry?.prompt || null;
});
var resetHistoryNavigationAtom = atom13(null, (get, set) => {
  set(historyModeAtom, false);
  set(historyIndexAtom, -1);
  set(originalInputAtom, "");
});

