var SORT_OPTION_MAP = {
  newest: "newest",
  oldest: "oldest",
  "most-expensive": "mostExpensive",
  "most-tokens": "mostTokens",
  "most-relevant": "mostRelevant"
};
function formatRelativeTime(ts) {
  const now = Date.now();
  const diff = now - ts;
  const seconds = Math.floor(diff / 1e3);
  const minutes = Math.floor(seconds / 60);
  const hours = Math.floor(minutes / 60);
  const days = Math.floor(hours / 24);
  if (days > 0) return `${days}d ago`;
  if (hours > 0) return `${hours}h ago`;
  if (minutes > 0) return `${minutes}m ago`;
  return "just now";
}
function formatCost(cost) {
  if (cost === 0) return "$0.00";
  if (cost < 0.01) return "<$0.01";
  return `$${cost.toFixed(2)}`;
}
function formatTokens(tokens) {
  if (tokens >= 1e6) {
    return `${(tokens / 1e6).toFixed(1)}M`;
  }
  if (tokens >= 1e3) {
    return `${(tokens / 1e3).toFixed(1)}K`;
  }
  return tokens.toString();
}
function truncate2(text, maxLength) {
  if (text.length <= maxLength) return text;
  return text.substring(0, maxLength - 3) + "...";
}
async function showTaskHistory(context, dataOverride) {
  const { taskHistoryData, taskHistoryLoading, taskHistoryError, fetchTaskHistory, addMessage } = context;
  const data = dataOverride || taskHistoryData;
  if (taskHistoryLoading && !dataOverride) {
    addMessage({
      ...generateMessage(),
      type: "system",
      content: "Loading task history..."
    });
    return;
  }
  if (taskHistoryError && !dataOverride) {
    addMessage({
      ...generateMessage(),
      type: "error",
      content: `Failed to load task history: ${taskHistoryError}`
    });
    return;
  }
  if (!data) {
    await fetchTaskHistory();
    addMessage({
      ...generateMessage(),
      type: "system",
      content: "Loading task history..."
    });
    return;
  }
  const { historyItems, pageIndex, pageCount } = data;
  if (historyItems.length === 0) {
    addMessage({
      ...generateMessage(),
      type: "system",
      content: "No tasks found in history."
    });
    return;
  }
  let content = `**Task History** (Page ${pageIndex + 1}/${pageCount}):

`;
  historyItems.forEach((task, index) => {
    const taskNum = pageIndex * 10 + index + 1;
    const taskText = truncate2(task.task || "Untitled task", 60);
    const time = formatRelativeTime(task.ts || 0);
    const cost = formatCost(task.totalCost || 0);
    const totalTokens = (task.tokensIn || 0) + (task.tokensOut || 0);
    const tokens = formatTokens(totalTokens);
    const favorite = task.isFavorited ? "\u2B50 " : "";
    content += `${favorite}**${taskNum}.** ${taskText}
`;
    content += `   ID: ${task.id} | ${time} | ${cost} | ${tokens} tokens

`;
  });
  addMessage({
    ...generateMessage(),
    type: "system",
    content
  });
}
