init_themes();
async function themeAutocompleteProvider(context) {
  if (!context.commandContext) {
    return [];
  }
  const config2 = context.commandContext.config;
  const availableThemeIds = getAvailableThemes(config2);
  const sortedThemes = availableThemeIds.map((themeId) => {
    const theme = getThemeById(themeId, config2);
    return {
      id: themeId,
      name: theme.name,
      description: theme.type,
      type: theme.type
    };
  }).sort((a, b) => {
    const typeOrder = { dark: 0, light: 1, custom: 2 };
    const typeAOrder = typeOrder[a.type] ?? 3;
    const typeBOrder = typeOrder[b.type] ?? 3;
    if (typeAOrder !== typeBOrder) {
      return typeAOrder - typeBOrder;
    }
    return a.id.localeCompare(b.id);
  });
  return sortedThemes.map((theme) => {
    return {
      value: theme.id,
      title: theme.name,
      description: theme.description,
      matchScore: 1,
      highlightedValue: theme.id
    };
  }).filter((item) => item !== null);
}
function getThemeDisplayInfo(config2) {
  const availableThemeIds = getAvailableThemes(config2);
  return availableThemeIds.map((themeId) => {
    const theme = getThemeById(themeId, config2);
    if (!theme) {
      return null;
    }
    return {
      id: themeId,
      name: theme.name,
      description: theme.type,
      type: theme.type
    };
  }).filter((item) => item !== null);
}
var themeCommand = {
  name: "theme",
  aliases: ["th"],
  description: "Switch to a different theme",
  usage: "/theme [theme-name]",
  examples: ["/theme dark", "/theme light", "/theme alpha"],
  category: "settings",
  priority: 8,
  arguments: [
    {
      name: "theme-name",
      description: "The theme to switch to (optional for interactive selection)",
      required: false,
      placeholder: "Select a theme",
      provider: themeAutocompleteProvider,
      /**
       * Validate theme argument against available themes
       */
      validate: async (value, _context) => {
        const config2 = _context.commandContext?.config;
        const availableThemeIds = getAvailableThemes(config2);
        const isValid = availableThemeIds.includes(value.trim().toLowerCase());
        return {
          valid: isValid,
          ...isValid ? {} : { error: `Invalid theme. Available themes: ${availableThemeIds.join(", ")}` }
        };
      }
    }
  ],
  handler: async (context) => {
    const { args, addMessage, setTheme, config: config2, refreshTerminal } = context;
    const availableThemeIds = getAvailableThemes(config2);
    try {
      if (args.length === 0 || !args[0]) {
        const allThemes = getThemeDisplayInfo(config2);
        const themesByType = allThemes.reduce(
          (acc, theme2) => {
            if (!acc[theme2.type]) {
              acc[theme2.type] = [];
            }
            acc[theme2.type].push(theme2);
            return acc;
          },
          {}
        );
        const typeOrder = ["dark", "light", "custom"];
        const helpText = ["**Available Themes:**", ""];
        typeOrder.forEach((type) => {
          const themes = themesByType[type] || [];
          if (themes.length > 0) {
            helpText.push(`**${type}:**`);
            themes.forEach((theme2) => {
              helpText.push(`  ${theme2.name} (${theme2.id})`);
            });
            helpText.push("");
          }
        });
        helpText.push("Usage: /theme <theme-name>");
        addMessage({
          ...generateMessage(),
          type: "system",
          content: helpText.join("\n")
        });
        return;
      }
      const requestedTheme = args[0].toLowerCase();
      if (!availableThemeIds.includes(requestedTheme)) {
        addMessage({
          ...generateMessage(),
          type: "error",
          content: `Invalid theme "${requestedTheme}". Available themes: ${availableThemeIds.join(", ")}`
        });
        return;
      }
      const theme = getThemeById(requestedTheme, config2);
      const themeName = theme.name || requestedTheme;
      try {
        addMessage({
          ...generateMessage(),
          type: "system",
          content: `Switched to **${themeName}** theme.`
        });
        await setTheme(requestedTheme);
        await refreshTerminal();
      } catch (error) {
        addMessage({
          ...generateMessage(),
          type: "error",
          content: `Failed to switch to **${themeName}** theme: ${error instanceof Error ? error.message : String(error)}`
        });
      }
    } catch (error) {
      addMessage({
        ...generateMessage(),
        type: "error",
        content: `Theme command failed: ${error instanceof Error ? error.message : String(error)}`
      });
    }
  }
};

