// src/state/hooks/useTaskHistory.ts
import { useAtom as useAtom2, useAtomValue as useAtomValue15, useSetAtom as useSetAtom7 } from "jotai";
import { useCallback as useCallback7 } from "react";
init_service();
init_logs();
function useTaskHistory() {
  const service = useAtomValue15(extensionServiceAtom);
  const [data] = useAtom2(taskHistoryDataAtom);
  const [filters] = useAtom2(taskHistoryFiltersAtom);
  const [pageIndex] = useAtom2(taskHistoryPageIndexAtom);
  const loading = useAtomValue15(taskHistoryLoadingAtom);
  const error = useAtomValue15(taskHistoryErrorAtom);
  const updateFilters = useSetAtom7(updateTaskHistoryFiltersAtom);
  const changePage2 = useSetAtom7(changeTaskHistoryPageAtom);
  const addPendingRequest = useSetAtom7(addPendingRequestAtom);
  const removePendingRequest = useSetAtom7(removePendingRequestAtom);
  const fetchTaskHistory = useCallback7(async () => {
    if (!service) {
      return;
    }
    try {
      await service.sendWebviewMessage({
        type: "taskHistoryRequest",
        payload: {
          requestId: Date.now().toString(),
          workspace: filters.workspace,
          sort: filters.sort,
          favoritesOnly: filters.favoritesOnly,
          pageIndex,
          search: filters.search
        }
      });
    } catch (err) {
      logs.error("fetchTaskHistory error:", "useTaskHistory", { error: err });
    }
  }, [service, filters, pageIndex]);
  const updateFiltersAndFetch = useCallback7(
    async (newFilters) => {
      if (!service) {
        throw new Error("Extension service not available");
      }
      updateFilters(newFilters);
      const requestId = `${Date.now()}-${Math.random()}`;
      const updatedFilters = { ...filters, ...newFilters };
      return new Promise((resolve3, reject) => {
        const timeout2 = setTimeout(() => {
          removePendingRequest(requestId);
          reject(new Error("Request timeout - no response received"));
        }, 5e3);
        addPendingRequest({ requestId, resolve: resolve3, reject, timeout: timeout2 });
        service.sendWebviewMessage({
          type: "taskHistoryRequest",
          payload: {
            requestId,
            workspace: updatedFilters.workspace,
            sort: updatedFilters.sort,
            favoritesOnly: updatedFilters.favoritesOnly,
            pageIndex: 0,
            // Filters reset to page 0
            search: updatedFilters.search
          }
        }).catch((err) => {
          removePendingRequest(requestId);
          reject(err);
        });
      });
    },
    [updateFilters, service, filters, addPendingRequest, removePendingRequest]
  );
  const changePageAndFetch = useCallback7(
    async (newPageIndex) => {
      if (!service) {
        throw new Error("Extension service not available");
      }
      changePage2(newPageIndex);
      const requestId = `${Date.now()}-${Math.random()}`;
      return new Promise((resolve3, reject) => {
        const timeout2 = setTimeout(() => {
          removePendingRequest(requestId);
          reject(new Error("Request timeout - no response received"));
        }, 5e3);
        addPendingRequest({ requestId, resolve: resolve3, reject, timeout: timeout2 });
        service.sendWebviewMessage({
          type: "taskHistoryRequest",
          payload: {
            requestId,
            workspace: filters.workspace,
            sort: filters.sort,
            favoritesOnly: filters.favoritesOnly,
            pageIndex: newPageIndex,
            search: filters.search
          }
        }).catch((err) => {
          removePendingRequest(requestId);
          reject(err);
        });
      });
    },
    [changePage2, service, filters, addPendingRequest, removePendingRequest]
  );
  const nextPage2 = useCallback7(async () => {
    if (data && pageIndex < data.pageCount - 1) {
      return await changePageAndFetch(pageIndex + 1);
    }
    return data || { historyItems: [], pageIndex: 0, pageCount: 0 };
  }, [data, pageIndex, changePageAndFetch]);
  const previousPage2 = useCallback7(async () => {
    if (pageIndex > 0) {
      return await changePageAndFetch(pageIndex - 1);
    }
    return data || { historyItems: [], pageIndex: 0, pageCount: 0 };
  }, [data, pageIndex, changePageAndFetch]);
  return {
    data,
    filters,
    pageIndex,
    loading,
    error,
    fetchTaskHistory,
    updateFilters: updateFiltersAndFetch,
    changePage: changePageAndFetch,
    nextPage: nextPage2,
    previousPage: previousPage2
  };
}

